Δεδομένου ότι Ο Πέδρο πήρε το θρόνο, παρόλο που υπήρξε συνέχεια του πολέμου για μήνες όπως και μια παρατεταμένη πικρία με από αυτόν. Επομένως, πρέπει να ισχύει ότι "10000 άνθρωποι πέθαναν στον πόλεμο."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Συζήτησαν στόχους σε κωδικοποιημένη γλώσσα, προσποιούμενοι ότι είναι φοιτητές που συζητούν πάνω σε διάφορους τομείς της  αρχιτεκτονικής που αναφέρονται στο Παγκόσμιο Κέντρο Εμπορίου, τις τέχνες του Πενταγώνου, το νόμο στο Καπιτώλιο και την πολιτική του Λευκού Οίκου. Επομένως, πρέπει να ισχύει ότι "Μίλησαν για την αρχιτεκτονική των αξιοθέατων και τα χρησιμοποίησαν για κωδικοποιημένες λέξεις."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Άλλα αποδεικτικά στοιχεία επιβεβαιώνουν τον λογαριασμό της. Επομένως, πρέπει να ισχύει ότι "Δεν έχουμε κανέναν απολύτως λόγο να πιστεύουμε τις εξηγήσεις της."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Οι δοκιμές αποτελεσματικότητας είναι το πρώτο βήμα, αλλά η εφαρμογή αποδεδειγμένου συστήματος ελέγχου του αλκοόλ και σύντομης παρέμβασης σε νοσοκομειακούς και κοινοτικούς χώρους ήταν το πιο δύσκολο μέρος της διαδικασίας. Επομένως, πρέπει να ισχύει ότι "Το τεστ αποτελεσματικότητας είναι το τελευταίο βήμα."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Επίσης, έχετε την ικανοποίηση να μάθετε ότι οι συνάδελφοί σας καλούνται να μιμηθούν την καλή κρίση σας. Επομένως, πρέπει να ισχύει ότι "Όλοι αποθαρρύνονται να συναγωνιστούν την τρομερή κρίση σας."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Αυτός είναι ο λόγος για τον οποίο δεν αποφοίτησα από το κολέγιο, αλλά εγώ ποτέ, ποτέ δεν διάβασα κανένα από τα βιβλία που έπρεπε να διαβάσω. Επομένως, πρέπει να ισχύει ότι "Δεν τελείωσα το κολλέγιο."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
